pub fn get(name: &str) -> Option<&'static DaisyUiTheme> {
    let name = name.trim();
    if name.is_empty() {
        return None;
    }
    let lower = name.to_lowercase();
    THEMES.iter().find(|t| t.name == name || t.name.to_lowercase() == lower)
}

pub fn names() -> Vec<&'static str> {
    THEMES.iter().map(|t| t.name).collect()
}
